import React from 'react';
import './App.css';
class Header extends React.Component {
    render(){
        return (
            <header class="fixed-top">
<div class="navbar navbar-expand-sm navbar-dark" style="background:rgb(94,171,34); opacity:0.9;">
<div class="container"><span class="navbar-brand" style="background:black;">
अन्नPoorna Kitchen
</span>
<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#mynav"><span class="navbar-toggler-icon" /></button>
<div class="collapse navbar-collapse" id="mynav">
<nav class="navbar-nav">
<a href="index.html" class="nav-item nav-link">Home</a>
<a href="order.html" class="nav-item nav-link">Order</a>
<a href="#rev" class="nav-item nav-link">Reviews</a>
<a href="#contact" class="nav-item nav-link">Contact Us</a>
</nav>
</div>
</div>
</div>
</header>
        );
    }
}
class App extends React.Component {
render(){ 
 return (<div>
     <Header />
 </div>);
}
}

export default App;
